                        previousPage.removeClass('cached page-on-right page-on-center').addClass('page-on-left');
                    if (previousNavbar && previousNavbar.length > 0)
                        previousNavbar.removeClass('cached navbar-on-right navbar-on-center').addClass('navbar-on-left');
